import netflixLogo from '../images/netflix_logo.jpg';
import userImg from '../images/user_image.jpg';
import styles from './Navigation.module.css'
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <div className={styles.navBar}>
      <div className={styles.navLeft}>
        <img id={styles.logo} src={netflixLogo} alt='netflixLogo' />
        <Link to='/' className={styles.navLeftItems}>Home</Link>
        <div className={styles.navLeftItems}>Movies</div>
        <div className={styles.navLeftItems}>Series</div>
      </div>
      <div className={styles.navRight}>
        <span class="material-symbols-outlined" id={styles.search}>
          search
        </span>
        <span class="material-symbols-outlined" id={styles.notif}>
          notifications
        </span>
        <img id={styles.user} src={userImg} alt='userImg' />
      </div>
    </div>
  );
};

export default Navigation;
